import React from "react";
import ReactDOM from "react-dom";
import { Link } from "react-router-dom";
import "./Navbar.css";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <Fragment id="nav">
          <li>
            <a href="#">Home Base</a>
          </li>
          <li>
            <a href="#">About Me</a>
          </li>
          <li>
            <a href="#">Portfolio</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </Fragment>
        {/* <ul id="nav">
          <li>
            <a href="#">Home Base</a>
          </li>
          <li>
            <a href="#">About Me</a>
          </li>
          <li>
            <a href="#">Portfolio</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul> */}
      </div>
    );
  }
}

class App extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <div>[Page content here]</div>
      </div>
    );
  }
}

// ReactDOM.render(<App />, document.getElementById("app"));

export default Navbar;
